import styled from 'styled-components';

const Dot = styled.div`
  background: var(--blue);
  color: white;
  font-size: 12px;
  font-weight: bold;
  padding-left: 8px;
  padding-right: 8px;
  border-radius: 20px;
`;

export default function CartCount({ count }) {
  return <Dot>{count}</Dot>;
}
